import React, { Component, Fragment } from 'react';
import { Link } from 'react-router-dom';
import classNames from 'classnames';
import Canvas from './Canvas';

import logo from '../../assets/img/header-logo-transparent-bg-compressed.png';

const navigationmenu = [
    {
        id: 1,
        linkText: 'Home',
        child: false,
        link: '/',
        submenu: []
    },
    {
        id: 2,
        linkText: 'Apartments',
        child: true,
        submenu: [
            {
                id: 21,
                link: '/apartment-details',
                linkText: 'Homestead'
            }
        ]
    },
    {
        id: 4,
        linkText: 'Details',
        child: true,
        submenu: [
            {
                id: 45,
                link: '/about',
                linkText: 'About Us'
            },
            {
                id: 43,
                link: '/gallery',
                linkText: 'Our Gallery'
            }
        ]
    }
];

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isMobile: false,
            isTop: false,
            toggleMethod: false
        };
    }

    componentDidMount() {
        window.addEventListener('resize', this.handleWindowSizeChange);
        window.addEventListener('scroll', this.handleScroll);
        this.handleWindowSizeChange();
        this.handleScroll();
    }

    componentWillUnmount() {
        window.removeEventListener('resize', this.handleWindowSizeChange);
        window.removeEventListener('scroll', this.handleScroll);
    }

    handleWindowSizeChange = () => {
        this.setState({ isMobile: window.innerWidth < 991 });
    };

    handleScroll = () => {
        this.setState({ isTop: window.scrollY > 110 });
    };

    toggleMenu = () => {
        this.setState(prevState => ({ toggleMethod: !prevState.toggleMethod }));
    };

    render() {
        const { isMobile, isTop, toggleMethod } = this.state;
        const className = isMobile ? 'breakpoint-on' : '';
        const stickyHeader = isTop ? 'sticky-active' : '';

        return (
            <Fragment>
                <header className={`header-absolute sticky-header ${stickyHeader}`} id="header">
                    <div className="container container-custom-one">
                        <div className={`nav-container d-flex align-items-center justify-content-between ${className}`}>
                            <div className={classNames("nav-menu d-lg-flex align-items-center", { "menu-on": toggleMethod })}>
                                <div className="navbar-close" onClick={this.toggleMenu}>
                                    <div className="cross-wrap"><span className="top" /><span className="bottom" /></div>
                                </div>
                                <div className="toggle">
                                    <Link to="#" id="offCanvasBtn" onClick={this.toggleMenu}><i className="fal fa-bars" /></Link>
                                </div>
                                <div className="menu-items">
                                    <ul>
                                        {navigationmenu.map((item) => (
                                            <li key={item.id} className={`menu-item ${item.child ? 'menu-item-has-children' : ''} `}>
                                                {item.child ? (
                                                    <Link onClick={e => e.preventDefault()} to="/">{item.linkText}</Link>
                                                ) : (
                                                    <Link to={item.link}>{item.linkText}</Link>
                                                )}
                                                {item.child && (
                                                    <ul className="submenu" role="menu">
                                                        {item.submenu.map((subItem) => (
                                                            <li key={subItem.id} className="menu-item">
                                                                <Link to={subItem.link}>{subItem.linkText}</Link>
                                                            </li>
                                                        ))}
                                                    </ul>
                                                )}
                                            </li>
                                        ))}
                                    </ul>
                                </div>
                                <div className="nav-pushed-item" />
                            </div>
                            <div className="site-logo">
                                <Link to="/"><img src={logo} alt="" /></Link>
                            </div>
                            <div className="nav-push-item">
                                <div className="header-info d-lg-flex align-items-center">
                                    <div className="item">
                                        <i className="fal fa-phone" />
                                        <span>Phone Number</span>
                                        <a href="tel:+3474439267">(347)-443-9267</a>
                                    </div>
                                    <div className="item">
                                        <i className="fal fa-envelope" />
                                        <span>Email Address</span>
                                        <Link to="mailto:info@urbanfoxrentals.com">info@urbanfoxrentals.com</Link>
                                    </div>
                                </div>
                            </div>
                            <div className={classNames("navbar-toggler", { "active": toggleMethod })} onClick={this.toggleMenu}>
                                <span /><span /><span />
                            </div>
                        </div>
                    </div>
                </header>
                <div className={classNames("offcanvas-wrapper", { "show-offcanvas": toggleMethod })}>
                    <div className={classNames("offcanvas-overly", { "show-overly": toggleMethod })} onClick={this.toggleMenu} />
                    <div className="offcanvas-widget">
                        <Link to="#" className="offcanvas-close" onClick={this.toggleMenu}><i className="fal fa-times" /></Link>
                        <Canvas />
                    </div>
                </div>
            </Fragment>
        );
    }
}

export default Header;
